import React, {useContext} from "react"
import './Plants.css'
import AppContext from "../Context";
import {Link} from 'react-router-dom'

function Plants(){
    return(
        <>
        <div className="plants-main">
            <Link to="/plants/annuals" className="plants-inner annuals"> Annuals</Link>
            <Link to="/plants/perennials" className="plants-inner perennials">Perennials</Link>
            <Link to="/plants/fruits" className="plants-inner fruits">Fruits</Link>
            <Link to="/plants/veggies" className="plants-inner veggies">Veggies</Link>
        </div>
        </>
    );
}

export default Plants;
